    {%- endmacro %}

    {% macro move_z() -%}
    {% set current_z = (z_start + (layer_number * z_delta))|float %}
    G1 Z{ current_z } F1200
    {%- endmacro %}

    {% macro z_hop() -%}
    G1 Z{ zhop|float } F1200
    {%- endmacro %}

    M109 S{ hotend_temp|int } T0
